const styles = theme => ({
    root: {},
    title: {
        marginTop: theme.spacing(1)
    },
    spacer: {
        flexGrow: 1
    },
    exportIcon: {
        marginRight: theme.spacing(1)
    },
    margin: {
        margin: theme.spacing(1)
    }
});
export default styles;
